## E. Evaluation Metrics

The evaluation metrics for emotion classification are the same as those in [8]: Accuracy (ACC) and F1 scores. They can be calculated by

$$
\begin{gathered}
\text { Accuracy }=\frac{\mathrm{TP}+\mathrm{TN}}{\mathrm{TP}+\mathrm{FP}+\mathrm{TN}+\mathrm{FN}} \\
\mathrm{~F} 1=2 \times \frac{\text { Precision } \times \text { Recall }}{\text { Precision }+ \text { Recall }}=\frac{\mathrm{TP}}{\mathrm{TP}+\frac{1}{2}(\mathrm{FP}+\mathrm{FN})}
\end{gathered}
$$

where TP denotes true positives, TN denotes true negatives, FP denotes false positives, and FN denotes false negatives.

The evaluation metrics for emotion regression are the same as those in [29]: root mean square error (RMSE), Pearson's correlation coefficient (PCC), and concordance correlation coefficient (CCC). Given the prediction $\hat{\mathbf{y}}$, and the continuous label y, RMSE, PCC, and CCC can be calculated by

$$
\begin{gathered}
\text { RMSE }=\left\|\frac{\hat{\mathbf{y}}-\mathbf{y}}{N}\right\|^{2}=\sqrt{\frac{\sum_{N-1}^{i=0}\left(\hat{y}_{i}-y_{i}\right)^{2}}{N}} \\
\mathrm{PCC}=\frac{\sigma_{\hat{\mathbf{y}} \mathbf{y}}}{\sigma_{\hat{\mathbf{y}}} \sigma_{\mathbf{y}}}=\frac{\sum_{N-1}^{i=0}\left(\hat{y}_{i}-\mu_{\mathbf{y}}\right)\left(y_{i}-\mu_{\mathbf{y}}\right)}{\sqrt{\sum_{N-1}^{i=0}\left(\hat{y}_{i}-\mu_{\mathbf{y}}\right)^{2}} \sqrt{\sum_{N-1}^{i=0}\left(y_{i}-\mu_{\mathbf{y}}\right)^{2}}}, \\
\mathrm{CCC}=\frac{2 \sigma_{\hat{\mathbf{y}} \mathbf{y}}}{\sigma_{\hat{\mathbf{y}}}^{2}+\sigma_{\hat{\mathbf{y}}}^{2}+\left(\mu_{\hat{\mathbf{y}}}-\mu_{\mathbf{y}}\right)}
\end{gathered}
$$

where $N$ denotes the number of elements in the prediction/label vector, $\sigma_{\hat{\mathbf{y}} \mathbf{y}}$ denotes the covariance, $\sigma_{\hat{\mathbf{y}}}$ and $\sigma_{\mathbf{y}}$ are the variances, and $\mu_{\hat{\mathbf{y}}}$ and $\mu_{\mathbf{y}}$ are the means.
